import React from "react";
import { useHistory,Redirect, BrowserRouter as Router } from "react-router-dom";
import store from "../Redux/Store";
import { connect } from 'react-redux';
import {addProduct} from "../Redux/Actions/ActionCreators"
export  function About(props) {
  let history = useHistory();
  function handler(){

    history.push('/products/view')
  }

  return (<div>Hey About!
    {props.numofProducts}
    <button onClick={handler}>test redux</button>
    <button onClick={props.addProduct}>Click me</button>
  </div>);



}
const mapStateToProps = state =>{
  return {
    numofProducts: state.numofProducts
  }
}
const mapDispatchToProps = dispatch =>{
  return {
    addProduct:()=>dispatch(addProduct())
  }
}

export default connect(mapStateToProps,mapDispatchToProps)(About)
